import 'dart:async';
import 'dart:io';

import 'package:face_analysis/Resources/constants.dart';
import 'package:face_analysis/Screens/beautyPlanScreen.dart';
import 'package:flutter/material.dart';
import 'package:http/http.dart' as http;

import '../../Networking/scanResultsClient.dart';
import '../../Resources/commonClass.dart';
import 'scanModel.dart';
import 'dart:convert';
import 'dart:io';
import 'dart:typed_data';

class ScanResultsScreen extends StatefulWidget {
  ScanResultsScreen({Key? key, required this.imagePath}) : super(key: key);
  final String imagePath;

  @override
  State<ScanResultsScreen> createState() => _ScanResultsScreenState();
}

class _ScanResultsScreenState extends State<ScanResultsScreen> {
  ScanResultsClient client = ScanResultsClient(http.Client());

  @override
  void initState() {
    getTags();
    super.initState();
  }

  @override
  Widget build(BuildContext context) {
    final view = MediaQuery.of(context).size;
    return Scaffold(
      extendBodyBehindAppBar: true,
      appBar: AppBar(
        backgroundColor: Colors.transparent,
        shadowColor: Colors.transparent,
        automaticallyImplyLeading: false,
      ),
      // The image is stored as a file on the device. Use the `Image.file`
      // constructor with the given path to display the image.
      body: Stack(fit: StackFit.expand, children: [
        SizedBox(
          height: view.height,
          width: view.width,
          child: FittedBox(
              child: Hero(tag: 1, child: Image.file(File(widget.imagePath))),
              fit: BoxFit.cover),
        ),
        SafeArea(
          child: Row(
            crossAxisAlignment: CrossAxisAlignment.start,
            children: [
              Expanded(
                child: Padding(
                  padding: const EdgeInsets.only(left: 16, right: 16),
                  child: instructions(
                    MediaQuery.of(context),
                    "Your face is being analysed!!",
                    fontSize: 18,
                    isTypeAnimation: true,
                  ),
                ),
              ),
            ],
          ),
        ),
        SizedBox(
          child: Center(
            child: Container(
              width: view.width / 1.5,
              height: (view.width / 1.5) + 60,
              child: const Image(
                fit: BoxFit.fitHeight,
                color: Colors.white,
                image: AssetImage("images/grid.png"),
              ),
              decoration: BoxDecoration(
                border: Border.all(color: Colors.transparent, width: 2),
                borderRadius: BorderRadius.all(
                  Radius.elliptical(
                      (view.width / 1.5) + 110, (view.width / 1.5) + 210),
                ),
              ),
            ),
          ),
        ),
      ]),
    );
  }

  Future getTags() async {
    Uint8List imageBytes =
        await File(widget.imagePath).readAsBytes(); //convert to bytes
    String base64string = base64.encode(imageBytes);

    var params = {
      'APIKey': Constants.APIKEY,
      'Tags': tags(),
      'ImageBytes': [base64string],
    };
    // var params = {
    //   'APIKey': Constants.APIKEY,
    //   'Tags': tags(),
    //   // 'ImageBytes': [base64string],
    //   'ImageBytes': [
    //     ""
    //   ]
    // };
    try {
      final response = await client.request(
          requestType: RequestType.POST,
          path: Path.getTags.name,
          parameter: params);
      ScanResults result = ScanResults.fromRawJson(response.body);
      if (result.Message?.toLowerCase() == "Success".toLowerCase()) {
        var tags = result.Tags;
        if (tags != null) {
          for (var element in tags) {
            if (element?.Status == true) {
              Navigator.push(
                context,
                MaterialPageRoute(builder: (context) {
                  return BeautyPlanScreen(
                    results: result,
                    imagePath: widget.imagePath,
                  );
                }),
              );
              break;
            } else if (element?.StatusCode == 101) {
              showToast("Unable to process, not enough resolution!",
                  isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 102) {
              showToast(
                  "Mix of side profile and front profile tags can not be processed on single input image!",
                  isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 103) {
              showToast("Image profile and requested tags are not matched",
                  isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 109) {
              showToast("Your photo resolution is too low!", isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 111) {
              showToast("POOR LIGHTING / Image is not a color image!",
                  isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 209) {
              showToast("Your photo is too dark!", isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 309) {
              showToast("Your photo is out of focus!", isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 415) {
              showToast("We could not detect your face!!", isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 509) {
              showToast("Face is too far away!", isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 709 ||
                element?.StatusCode == 809 ||
                element?.StatusCode == 909) {
              showToast("Uneven Lighting!", isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 1009) {
              showToast("Photo is too shiny!", isError: true);
              Navigator.pop(context);
              break;
            } else if (element?.StatusCode == 1209) {
              showToast("Too much tilt in face!", isError: true);
              Navigator.pop(context);
              break;
            }
          }
        }
      } else {
        showToast(result.Message ?? "");
        Navigator.pop(context);
      }
    } catch (error) {
      showToast("Something went wrong.\nPlease try again!!", isError: true);
      Navigator.pop(context);
    }
  }

  List<String> tags() {
    List<String> tag = [];

    for (var element in Tags.values) {
      tag.add(element.name);
    }
    return tag;
  }
}

enum Tags {
  WRINKLES_SEVERITY_SCORE_FAST,
  WRINKLES_IMAGE_FAST,
  ACNE_SEVERITY_SCORE_FAST,
  ACNE_IMAGE_FAST,
  SPOTS_SEVERITY_SCORE_FAST,
  SPOTS_IMAGE_FAST,
  PORES_SEVERITY_SCORE_FAST,
  PORES_IMAGE_FAST,
  REDNESS_SEVERITY_SCORE_FAST,
  UNEVEN_SKINTONE_SEVERITY_SCORE_FAST,
  UNEVEN_SKINTONE_IMAGE,
  DARK_CIRCLES_SEVERITY_SCORE_FAST,
  DARK_CIRCLES_IMAGE,
  SHININESS_SEVERITY_SCORE_FAST,
  SHININESS_IMAGE_FAST,
  DEHYDRATION_SEVERITY_SCORE_FAST,
  DEHYDRATION_IMAGE_FAST,
  NASOLABIAL_FOLDS_SEVERITY_SCORE_FAST,
  UNDEREYE_PUFFINESS_SEVERITY_SCORE_FAST,
  SKINAGE,
  ELASTICITY,
  FIRMNESS,
  PANTONE_SKINTONE_MATCH,
  TEXTURE_SEVERITY_SCORE_FAST,
  OILINESS_SEVERITY_SCORE_FAST,
}
